function SkillConfig.GetConfig(key)
	local tb = SkillConfig.Values[key]
	if not tb then
		print_error(string.format("key type is %s,key = %s",type(key),key))
		return nil
	end
	local config = {["id"] = 1,["level"] = 2,["lvmax"] = 3,["skillname"] = 4,["type"] = 5,["desc"] = 6,["value1"] = 7,["value2"] = 8,["value3"] = 9,["value4"] = 10,["icon"] = 11,["upgradecost"] = 12,["consumenum"] = 13,["coin"] = 14,["nazo"] = 15,}
	for k,v in pairs(config) do
		config[k] = tb[v]
	end
	return config 
end
return SkillConfig